import React, {useState} from 'react';
import Navigation from '../components/Navigation';
import ToggleSwitch from '../components/ToggleSwitch'
import Footer from '../components/Footer';
import axios from 'axios';


function AddNew(){
  
  const [viewSettings, setViewSettings] = useState(false);
  const [savePassword, setSavePassword] = useState(false);
  const [useLower, setUseLower] = useState(true);
  const [useUpper, setUseUpper] = useState(true);
  const [useNum, setUseNum] = useState(true);
  const [useSym, setUseSym] = useState(true);
  
  async function generatePassword() {
    const baseUrl='http://127.0.0.1:5000/'
    var lowParam="lower=" + String(useLower)
    var upParam="upper=" + String(useUpper)
    var numParam="nums=" + String(useNum)
    var symParam="sym=" + String(useSym)
    var lenParam="length=" + String(12)
    var completeUrl = baseUrl + "?"+ lowParam + "&" + upParam + "&" + numParam + "&" + symParam + "&" + lenParam
    const { meta, data } = await axios.get(completeUrl)
    return (console.log(data.password))
  }

  return (
    <div>
      <Navigation />
      <body className="main-content">
        <h2>Generate New Passwword</h2>
        <div className='password-generator'>
        <button onClick={generatePassword}> Generate Password </button>
        </div>
        <form className="add-new-form">
          <div className="toggle-container">
            <ToggleSwitch
              isOn={viewSettings}
              handleToggle = {() => setViewSettings(!viewSettings)}/>
            <div className='toggle-label'>
              <p>View Settings</p>   
            </div>
          </div>         
          <div className="toggle-container">
            <ToggleSwitch
              isOn={savePassword}
              handleToggle = {() => setSavePassword(!savePassword)}/>
              <p className="toggle-label">Allow Saving</p>   
          </div>
          <div className="more-settings">
          <div className="toggle-container">
            <ToggleSwitch
              isOn={useLower}
              handleToggle = {() => setUseLower(!useLower)}/>
            <div className='toggle-label'>
              <p>View Settings</p>   
            </div>
          </div> 
          <div className="toggle-container">
            <ToggleSwitch
              isOn={useUpper}
              handleToggle = {() => setUseUpper(!useUpper)}/>
            <div className='toggle-label'>
              <p>View Settings</p>   
            </div>
          </div> 
          <div className="toggle-container">
            <ToggleSwitch
              isOn={useNum}
              handleToggle = {() => setUseNum(!useNum)}/>
            <div className='toggle-label'>
              <p>View Settings</p>   
            </div>
          </div> 
          <div className="toggle-container">
            <ToggleSwitch
              isOn={useSym}
              handleToggle = {() => setUseSym(!useSym)}/>
            <div className='toggle-label'>
              <p>View Settings</p>   
            </div>
          </div> 
          </div>
        </form>
      </body>
      <Footer />  
    </div>
  );
};

export default AddNew
